void armController::UpdateSensorData()
{
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "Entering armController::UpdateSensorData");
  // all servers have 
  // inputs: int64 goal, bool update
  // output: current
  motor_controller::radialPosition rPos;
  rPos.request.update = false;
  rPos.request.setZeroPosition = false;
  radialPositionClient.call(rPos);
  currentRadialPos = rPos.response.current;

  motor_controller::verticalPosition vPos;
  vPos.request.update = false;
  vPos.request.setZeroPosition = false;
  verticalPositionClient.call(vPos);
  currentVerticalPos = vPos.response.current;

  motor_controller::armRotation arm;
  arm.request.update = false;
  armRotationClient.call(arm);
  currentArmRotation = arm.response.current;

  motor_controller::gripperRotation gRot;
  gRot.request.update = false;
  gripperRotationClient.call(gRot);
  currentGripperRotation = gRot.response.current;

  motor_controller::gripperPosition gPos;
  gPos.request.update = false;
  gripperPositionClient.call(gPos);
  currentGripperPos = gPos.response.current;
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "Exiting armController::UpdateSensorData");
}

void armController::UpdateArmPosition()
{
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "Entering armController::UpdateArmPosition");
  // all servers have 
  // inputs: int64 goal, bool update
  // output: current
  motor_controller::radialPosition rPos;
  rPos.request.update = true;
  rPos.request.setZeroPosition = false;
  rPos.request.goal = goalRadialPos;
  radialPositionClient.call(rPos);
  currentRadialPos = rPos.response.current;

  motor_controller::verticalPosition vPos;
