  comp_queue.ROSMOD_LOGGER->log("DEBUG", "GRIPPER ROTATION GOAL: %f",goalGripperRotation);
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "GRIPPER ROTATION : %f",currentGripperRotation);
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "GRIPPER POSITION GOAL: %f",goalGripperPos);
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "GRIPPER POSITION : %f",currentGripperPos);
  #endif
  if ( abs(goalRadialPos - currentRadialPos) > radialEpsilon )
    return false;
  if ( abs(goalVerticalPos - currentVerticalPos) > verticalEpsilon )
    return false;
  if ( abs(goalArmRotation - currentArmRotation) > armRotationEpsilon )
    return false;
  if ( abs(goalGripperRotation - currentGripperRotation) > gripperRotationEpsilon )
    return false;
  if ( abs(goalGripperPos - currentGripperPos) > gripperPosEpsilon )
    return false;
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "REACHED GOALS!");
  return true;
}

void armController::Init_StateFunc()
{
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "Entering armController::Init_StateFunc");
  // Init zeroes out the positions of the linear actuators for calibration
  static bool zeroedHeight = false;
  static bool zeroedRadius = false;
  static unsigned int zeroingMovementOffset = 100000;
  if (!zeroedHeight)
  {
    motor_controller::verticalPosition vPos;
    vPos.request.update = true;
    vPos.request.setZeroPosition = false;
    vPos.request.goal = currentVerticalPos - zeroingMovementOffset;
    verticalPositionClient.call(vPos);
    if (vPos.response.lowerLimitReached)
    {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "ZEROED HEIGHT!");
      vPos.request.update = false;
      vPos.request.setZeroPosition = true;
      verticalPositionClient.call(vPos);
      zeroedHeight = true;
    }
  }
  else if (!zeroedRadius)
  {
    motor_controller::radialPosition rPos;
    rPos.request.update = true;
    rPos.request.setZeroPosition = false;
    rPos.request.goal = currentRadialPos - zeroingMovementOffset;
    radialPositionClient.call(rPos);
    if (rPos.response.lowerLimitReached)
    {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "ZEROED RADIUS!");
      rPos.request.update = false;
      rPos.request.setZeroPosition = true;
      radialPositionClient.call(rPos);
      zeroedRadius = true;
    }
  }
  else
  {
    //      ROS_INFO("ZEROED EVERYTHING");
    motor_controller::verticalPosition vPos;
    vPos.request.update = true;
    vPos.request.setZeroPosition = false;
    vPos.request.goal = 0;
    verticalPositionClient.call(vPos);
    motor_controller::radialPosition rPos;
    rPos.request.update = true;
    rPos.request.setZeroPosition = false;
    rPos.request.goal = 0;
    radialPositionClient.call(rPos);

    goalRadialPos = minRadialPos;
    goalVerticalPos = minVerticalPos;
    goalArmRotation = minArmRotation;
    goalGripperRotation = currentGripperRotation;
    goalGripperPos = gripperPosOpened;

    currentState = OPENING_PB;
    stateChanged = true;
  }
  comp_queue.ROSMOD_LOGGER->log("DEBUG", "Exiting armController::Init_StateFunc");
}

