      Finding_PB_StateFunc();
    UpdateArmPosition();
    break;
    case OPENING_PB:
    Opening_PB_StateFunc();
    UpdateArmPosition();
    break;
    case FINDING_SAMPLE:
    if ( CheckGoals() )
      Finding_Sample_StateFunc();
    UpdateArmPosition();
    break;
