      Carrying_Sample_StateFunc();
    UpdateArmPosition();
    break;
    case INSERTING_SAMPLE:
    if ( CheckGoals() )
      Inserting_Sample_StateFunc();
    UpdateArmPosition();
    break;
    case CLOSING_PB:
    if ( CheckGoals() )
      Closing_PB_StateFunc();
    UpdateArmPosition();
    break;
    case MOVING_AWAY:
