attributes.Operation:
if (noGPIO == false) {

  // Business Logic for userInputTimer
  // HANDLE MISSILE SWITCHES HERE
  unsigned int previousSwitchState = pauseSwitchState;
  gpio_get_value(pauseSwitchPin, &pauseSwitchState);
  //  ROS_INFO("Pause Switch State: %d", pauseSwitchState);

  high_level_controller::controlInputs control;

  if ( previousSwitchState != pauseSwitchState )
  {
    paused = (pauseSwitchState == HIGH) ? true : false;
    if (paused) {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "Pausing the system!");
    }
    else {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "Unpausing the system!");
    }
  }
  previousSwitchState = haltSwitchState;
  gpio_get_value(haltSwitchPin, &haltSwitchState);
  if ( previousSwitchState != haltSwitchState )
  {
    halted = (haltSwitchState == HIGH) ? true : false;
    if (halted) {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "Halting the system!");
    }
    else {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "Un-halting the system!");
    }
  }
  previousSwitchState = manualSwitchState;
  gpio_get_value(manualSwitchPin, &manualSwitchState);
  if ( previousSwitchState != manualSwitchState )
  {
    manual= (manualSwitchState == HIGH) ? true : false;
    if (manual) {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "Switching the system to manual!");
    }
    else {
      comp_queue.ROSMOD_LOGGER->log("DEBUG", "Switching the system to automatic!");
    }
  }
  control.paused = paused;
  control.stop = halted;
  control.manual = manual;
  controlInputsPublisher.publish(control);

  // HANDLE LED OUTPUTS HERE
  static int currentPauseLEDBlinkDelay = 0;
  static int currentSampleLEDBlinkDelay = 0;
  static int currentBayLEDBlinkDelay = 0;

  if (paused)
  {
    gpio_set_value(pauseLED, HIGH);
  }
  else
  {
    if (currentPauseLEDBlinkDelay++ < pauseLEDBlinkDelay)
      gpio_set_value(pauseLED,LOW);
    else
    {
      gpio_set_value(pauseLED,HIGH);
      currentPauseLEDBlinkDelay = 0;
    }
  }

  if (halted) {
    gpio_set_value(alarmLED, HIGH);
  }
  else {
    gpio_set_value(alarmLED, LOW);
  }

  switch (arm.state) {
    case 0:
    // INIT
    gpio_set_value(initLED[0], HIGH);
    break;
    case 1:
    // OPENING_PB
    gpio_set_value(initLED[0], LOW); // Switch OFF Blue
    gpio_set_value(initLED[1], HIGH); // Switch ON Green
    gpio_set_value(bayLED[0], LOW); // Switch OFF Blue
    //    gpio_set_value(bayLED[1], HIGH); // Switch ON Green    
    break;
    case 2:
    // FINDING_SAMPLE
    gpio_set_value(sampleLED[0], HIGH); // Switch ON Blue
    break;
    case 3:
    // FINDING_PB
    gpio_set_value(bayLED[0], HIGH); // Blue

    // Blink Sample LED Green
    gpio_set_value(sampleLED[0], LOW); // Switch ON Blue
    if (currentSampleLEDBlinkDelay++ < sampleLEDBlinkDelay)
      gpio_set_value(sampleLED[1], LOW);
    else
    {
      gpio_set_value(sampleLED[1], HIGH);
      currentSampleLEDBlinkDelay = 0;
    }
    break;
    case 4:
    // GRABBING_SAMPLE
    gpio_set_value(sampleLED[0], LOW); // Switch OFF Blue
    gpio_set_value(sampleLED[1], HIGH); // Switch ON Green    

    // Blink Payload Bay LED Gree
    gpio_set_value(bayLED[0], LOW); // Switch OFF Blue
    if (currentBayLEDBlinkDelay++ < bayLEDBlinkDelay)
      gpio_set_value(bayLED[1], LOW);
    else
    {
      gpio_set_value(bayLED[1], HIGH);
      currentBayLEDBlinkDelay = 0;
    }
    break;
    case 5:
    gpio_set_value(bayLED[1], HIGH);
    gpio_set_value(sampleLED[1], HIGH);
    break;
    default:
    break;
  }
}

if (!paused)
{
  // read current value for vertical position (encoder)
  verticalCurrent = verticalMotoreQEP.get_position();
  //ROS_INFO("Vertical Actuator Encoder Reading: %d",verticalCurrent);

  static unsigned int prevVerticalCurrent = verticalCurrent + 100;

  unsigned int limitSwitchState = 0;
  unsigned int backwardPinState = 0;
  //gpio_get_value(lowerLimitSwitchPin,&limitSwitchState);
  gpio_get_value(motorBackwardPin,&backwardPinState);
  if (backwardPinState && (prevVerticalCurrent == verticalCurrent))
  {
    lowerLimitReached = true;
  }

  unsigned int upperLimitSwitchState = 0;
  unsigned int forwardPinState = 0;
  //gpio_get_value(upperLimitSwitchPin, &upperLimitSwitchState);
  gpio_get_value(motorForwardPin, &forwardPinState);
  if (forwardPinState && (prevVerticalCurrent == verticalCurrent))
  {
    upperLimitReached = true;
  }

  prevVerticalCurrent = verticalCurrent;

  // update motor based on current value
  if ( abs(verticalGoal-verticalCurrent) > epsilon ) // if there's significant reason to move
  {
    if (verticalGoal > verticalCurrent) 
    {
      lowerLimitReached = false;
      gpio_set_value(motorBackwardPin,LOW);
      gpio_set_value(motorForwardPin,HIGH);
    }
    else
    {
      upperLimitReached = false;
      gpio_set_value(motorForwardPin,LOW);
      gpio_set_value(motorBackwardPin,HIGH);
    }
  }
  else
  {
    gpio_set_value(motorForwardPin,LOW);
    gpio_set_value(motorBackwardPin,LOW);
  }
}
else 
{
  gpio_set_value(motorForwardPin,LOW);
  gpio_set_value(motorBackwardPin,LOW);      
}

  if (req.update == true)
  {
    radialGoal = req.goal;
  }
if (req.setZeroPosition == true)
  {
    ROS_INFO("ZEROED RADIAL ENCODER");
    radialMotoreQEP.set_position(0);
  }
res.lowerLimitReached = lowerLimitReached;
res.upperLimitReached = upperLimitReached;
res.current = radialCurrent;
return true;
